dna = ""
dna = dna.lower()

palindrones = set()
palindrones_index = []

dna_length = len(dna)

for i,n in enumerate(dna):
    # check for 8
    if(i+7 < dna_length ):
        flag = 1
        for j in range(0,4):
            a = dna[i+j]
            b = dna[i+7-j]
            if((not(a=='g' and b=='c')) and (not(a=='c' and b=='g')) and (not(a=='t' and b=='a')) and (not(a=='a' and b=='t'))):
                flag = 0
        if(flag==1):
            palindrones.add(dna[i:i+8])
            palindrones_index.append([i,i+7])

    if(i+5 < dna_length ):
        flag = 1
        for j in range(0,3):
            a = dna[i+j]
            b = dna[i+5-j]
            if((not(a=='g' and b=='c')) and (not(a=='c' and b=='g')) and (not(a=='t' and b=='a')) and (not(a=='a' and b=='t'))):
                flag = 0
        if(flag==1):
            palindrones.add(dna[i:i+6])
            palindrones_index.append([i,i+5])
    
    if(i+3 < dna_length ):
        flag = 1
        for j in range(0,2):
            a = dna[i+j]
            b = dna[i+3-j]
            if((not(a=='g' and b=='c')) and (not(a=='c' and b=='g')) and (not(a=='t' and b=='a')) and (not(a=='a' and b=='t'))):
                flag = 0
        if(flag==1):
            palindrones.add(dna[i:i+4])
            palindrones_index.append([i,i+3])

for pal in palindrones:
    print(pal)
